/*         Gateway Routine         */

void mexFunction(
   int             nlhs,
   mxArray  *plhs[],
   int             nrhs,
   const mxArray  *prhs[]
   )
{
   double          *f;
   double          *J;
   double          *data;
   double          *x;
   double          *param;
   double          *v;
   /* Create a matrix for the return argument */

   plhs[0] = mxCreateDoubleMatrix( 182, 1, mxREAL);

   plhs[1] = mxCreateDoubleMatrix( 182, 362, mxREAL);

   /* Assign pointers to the various parameters */

   f = mxGetPr(plhs[0]);

   J = mxGetPr(plhs[1]);

   data = mxGetPr(prhs[0]);
   x = mxGetPr(prhs[1]);
   param = mxGetPr(prhs[2]);
   v = mxGetPr(prhs[3]);
   /* Do the actual computations in a subroutine */

  IEEE118(f,J,data,x,param,v);
   return;
}
